import './App.css';
import Navbar from './Navbar';
import GuestForm from './GuestForm';

function App() {

  return (
    <div className="App">
      <Navbar />
      <div className="App-main">
        <header className="App-header">
          <h1>Your Artist Tracker!</h1>
        </header>
        <div className="mb-3 row">
          <div className="App-form col-12">
            <GuestForm />
          </div>

        </div>

        <div className="App-right">
          <p>Create an account to save your favorite artists! Every time you log in, you'll see
            a list of their shows near you!
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
